INSERT INTO `blog` (`blog_id`, `blog_title`, `blog_text`, `blog_image`, `blog_category`, `commentable`, `writer_email`) VALUES
(15, 'The New, Big Money Signing', 'Real Betis have made some big changes this season after ending their last campaign with a string of poor results. The old manager Quique Setein has moved on to pastures new, and new manager Rubi has taken the reins. Rubi left Espanyol and European football in order to help Betis rebuild themselves, and they have made some shrewd moves in the transfer market to help him get the job done.\r\n\r\nMany players have left the club, either sold or on loan, most notably the stalwart goalkeeper Pau Lopez, who moved to AS Roma in a big money deal worth €23.5 million. This deal, along with the transfer of Junior Firpo to Spanish super club Barcelona for €18 million, has given the club a big pot to play with in this summer’s transfer market.\r\n\r\nThey have already made three important signings to help Rubi reach the top, and here we are going to look at what they can bring to Betis this season and how they can make a difference.', , 'Sport', 'true', 'uftunca@gmail.com');
INSERT INTO `blog` (`blog_id`, `blog_title`, `blog_text`, `blog_image`, `blog_category`, `commentable`, `writer_email`) VALUES
(16, '4 South American Countries', 'Peru\r\nAs a tourist destination, Peru is best known for the Lost City of Machu Picchu, to which travelers flock from all over the globe. And when you see it for yourself, you’ll see why. The country is teeming with ancient ruins and remnants of historic Incan civilizations nestled amidst gorgeous mountain terrain. It is also home to several ancient cities such as Lima and Cuzco, as well as some of the most stunning, remote hikes you’ll ever walk.\r\n\r\nBrazil\r\nSouth America’s largest country, Brazil should be on everyone’s travel bucket list. If incredible weather and gorgeous beaches aren’t enough to sway you, how about the fact that it is home to the world-famous Carnival in Rio de Janeiro? Marvel at the outrageous costumes and party atmosphere and dance in the street until the sun comes up above the iconic Christ the Redeemer statue on top of Corcovado mountain. Sports fans won’t be disappointed either, as Brazil is the home of the best soccer team in the world, and the sport is a huge part of the culture. Alternatively, you can get your adventure fix with a trip to the lush Amazon rainforest. Just don’t forget your bug spray.\r\n\r\nEcuador\r\nEcuador is an undiscovered jewel in South America’s crown, and it has gone largely unnoticed by the huge swathes of tourists who visit the continent each year. But the country is home to some of the most incredible sights on Earth, including the Ecuador rainforest and Galapagos Islands. Witness some unique wildlife such as black iguanas and gigantic Galapagos tortoises. Take a hike to the base of the picture-perfect snow-capped volcano Cotopaxi, the country’s second-highest summit, or visit the city of Banos to get your adventure fix with a bungee jump or white water rafting trip. Culture vultures can wander the streets of the historic capital city Quito, or sample Ecuador’s many culinary delights such as ceviche or the world’s best dark chocolate.\r\n\r\nChile\r\nNo trip to South America can be complete without visiting Chile. The country has so much to offer that it’s impossible to see it all in a single trip. Head down south to explore the mountainous national parks of Patagonia, and you may even see wild pumas and penguins in their natural habitat. Or if you prefer warmer weather, you could head up north to the Atacama Desert – the driest on Earth with the most beautiful starry night skies you’ll ever see.', , 'Country', 'false', 'uftunca@gmail.com');
INSERT INTO `blog` (`blog_id`, `blog_title`, `blog_text`, `blog_image`, `blog_category`, `commentable`, `writer_email`) VALUES
(18, 'Three Books By Indie Publishers', 'The last ten months or so have been very tough for the publishing industry in general, and particularly challenging for small indie presses who have still succeeded in bringing brilliant new books in to the world during a pandemic no less. One of those is Exit Management by Naomi Booth which was published by Dead Ink Books last summer. Originally from the north of England, Lauren works at a City firm as a graduate HR executive and specialises in “exit management”, otherwise known as firing people in less corporate terms. She is very ambitious about climbing the property ladder, even in a city where she discovers early on that a bedsit in Deptford will always be advertised as a “luxury studio in outer Greenwich”. Callum is a young man in his twenties who lives with his parents in Croydon and lands a job at GuestHouse, a company which finds elite temporary residences in London for the super-rich. Callum forms a close bond with one of his clients, József, a terminally ill elderly man who came to live in England from Hungary as a refugee in 1956. When Callum and Lauren meet by chance outside József‘s home in Elgin Mews, Lauren assumes that Callum owns the property, and the lives of the three characters become drawn together in unexpected ways. I think the characterisation is particularly strong in this novel, as it explores', , 'Book', 'true', 'uftunca@gmail.com');
INSERT INTO `blog` (`blog_id`, `blog_title`, `blog_text`, `blog_image`, `blog_category`, `commentable`, `writer_email`) VALUES
(20, 'Canva', 'You’ve marketed your art by maintaining a strong online presence, like through your Public Profile on Artwork Archive. Or maybe you’ve built a relationship with a client and shown them your work with a curated Portfolio Page report. \r\n\r\nNow it\'s time to manage the next step of your project by using a commission contact to nail out the terms and conditions for your work agreement.', , 'Art', 'true', 'uftunca@gmail.com');
INSERT INTO `blog` (`blog_id`, `blog_title`, `blog_text`, `blog_image`, `blog_category`, `commentable`, `writer_email`) VALUES
(21, 'Five Colors in Colombia', 'Caño Cristales or Crystal Channel locally known as the River of Five Colors or the Liquid Rainbow, is a natural occurring water feature found in the geographic center part of Colombia. Noted for its outstanding coloration, travelers have often referred to it as being the most beautiful river on earth.  It is the 16th stop in the travel series “A World Far And Away”.\r\n\r\nThe Crystal Channel or Caño Cristales river is just over 62 miles long (100 kilometers) and features a spectacular coloration, that include hues of red, orange, green, blue and yellow. It is the only place in the world, where travelers can see this sort of vibrant color assortment in such abundance.', , 'Country', 'true', 'uftunca@gmail.com');
INSERT INTO `blog` (`blog_id`, `blog_title`, `blog_text`, `blog_image`, `blog_category`, `commentable`, `writer_email`) VALUES
(22, 'I Have Read Recently', 'The Fragments of my Father by Sam Mills is a memoir about the author’s experience of being a carer for both of her parents in different circumstances. Her father has had mental health problems including schizophrenia since she was a child. Her mother was later diagnosed with cancer and died in 2012, after which Mills became the main carer for her father. Mills interweaves a bit of literary biography of Virginia and Leonard Woolf and Zelda and F. Scott Fitzgerald and how their relationships were shaped by caring responsibilities. I might have expected the literary biography elements to feel like unnecessary padding to the book, but Mills makes a convincing case that Leonard has sometimes been unfairly portrayed as a controlling husband when Virginia’s illness meant that he had to make difficult decisions in her interests in his role as her carer. Mills also explores the impact of being a carer on her own creative life as a novelist as well as setting up and running the indie publisher Dodo Ink. She is very frank about the guilt she feels when taking even the briefest break away from her caring duties and how this has affected her relationships with other people. With around 6.5 million unpaid carers in the UK alone, ‘The Fragments of my Father’ makes an exceptionally strong case towards the need to improve financial and emotional support for those making personal sacrifices every day in order to provide care for their loved ones.', , 'Book', 'false', 'uftunca@gmail.com');
INSERT INTO `blog` (`blog_id`, `blog_title`, `blog_text`, `blog_image`, `blog_category`, `commentable`, `writer_email`) VALUES
(23, 'Rugby Union Players', '5 of the best Scottish Rugby players of all time.\r\nThe first-ever international rugby match took place in Edinburgh in 1871 between Scotland and England.  It is still a huge occasion for fans from both countries as the teams battle it out to win the Calcutta Cup. Scotland has produced many highly skilled, tough and committed players during its long history in International rugby. \r\n\r\nIt’s a hard task to pick just five players for this list. There have been so many that could be mentioned here. Players like Gavin Hastings, Greg Laidlaw, Doddie Weir, and the current head coach Gregor Townsend. I could go on, the list is almost endless. \r\n\r\nDaniel Cullinane has chosen the current Scotland Captain and all-rounder, the record point’s scorer, two famous captains and the record try scorer.', , 'Sport', 'true', 'uftunca@gmail.com');
